// src/pages/SocialFeed.js
import React from 'react';

const SocialFeed = () => {
  return (
    <div>
      <h1 className="text-3xl font-display font-bold mb-6">Social Feed</h1>
      <p>Social feed content will be displayed here.</p>
    </div>
  );
};

export default SocialFeed;
